import React, { useState, useEffect } from "react";
import axios from "axios";
import { LabOverview } from "../../Lab Overview/LabOverview";

export const DivWrapper = ({ onViewProfile }) => {
  const [labs, setLabs] = useState([]);
  const [showLabOverview, setShowLabOverview] = useState(false);

  const handleClick = () => {
    navigate(`/lab/${lab._id}`);
};


  useEffect(() => {
    const fetchLabs = async () => {
      try {
        const response = await axios.get("http://localhost:8080/api/labs");
        setLabs(response.data.data);
        console.log(response.data.data);
      } catch (error) {
        console.error("Error fetching lab data", error);
      }
    };

    fetchLabs();
  }, []);

  return (
    <>
      {showLabOverview ? (
        <LabOverview />
      ) : (
        <div className="flex flex-col w-[1580px] items-start gap-5 absolute top-[441px] left-[60px]">
          {labs.length === 0 ? (
            <div>Loading labs...</div>
          ) : (
            labs.map((lab) => (
              <div
                key={lab.id}
                className="flex flex-col w-[1060px] items-start gap-4 p-8 bg-white rounded-2xl border border-[#cbcbcb] shadow-[0px_0px_15px_#0000000d]"
              >
                <div className="flex gap-[18px]">
                  <img
                    className="w-[106px] h-[106px] object-cover"
                    alt="Logo"
                    src={lab.logo}
                  />
                  <div className="flex flex-col justify-between">
                    <h2 className="text-xl font-bold text-[#202224]">
                      {lab.company_name}
                    </h2>
                    <p>{lab.description}</p>
                    <div>
                      <strong>Accreditation:</strong> {lab.accreditation}
                    </div>
                    <div>
                      <strong>Location:</strong> {lab.location}
                    </div>
                    <div>
                      <strong>Expertise:</strong> {lab.expertise}
                    </div>
                    <div>
                      <strong>Industries:</strong> {lab.industries.join(", ")}
                    </div>
                  </div>
                </div>
                <div className="flex items-start gap-2 relative self-stretch w-full flex-[0_0_auto] mb-[-0.01px]">
                  <div className="flex w-[317px] items-center justify-center gap-2 px-0 py-1 relative rounded-2xl border border-solid border-[#dddddd]">
                    <div className="relative w-6 h-6">
                      <img
                        className="absolute w-[19px] h-[21px] top-0.5 left-[3px]"
                        alt="Group"
                        src="https://c.animaapp.com/ma15u5wlRvwvT0/img/group-3.png"
                      />
                    </div>

                    <div className="w-fit font-medium text-[#d50000] relative [font-family:'Nunito_Sans',Helvetica] text-sm tracking-[-0.06px] leading-[normal]">
                      Delete
                    </div>
                  </div>
                  <div
                    className="flex w-[317px] items-center justify-center gap-2 px-0 py-1 relative rounded-2xl border border-solid border-[#dddddd] cursor-pointer"
                    onClick={() => setShowLabOverview(true)}
                  >
                    <img
                      className="relative w-6 h-6"
                      alt="Building user"
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/building-user--1--1.svg"
                    />

                    <div className="w-fit font-medium text-[#6161ff] relative [font-family:'Nunito_Sans',Helvetica] text-sm tracking-[-0.06px] leading-[normal]">
                      <button onClick={onViewProfile}>View Profile</button>
                    </div>
                  </div>

                  <div className="flex w-[317px] items-center justify-center gap-2 px-0 py-1 relative rounded-2xl border border-solid border-[#dddddd]">
                    <img
                      className="relative w-6 h-6"
                      alt="Comment"
                      src="https://c.animaapp.com/ma15u5wlRvwvT0/img/comment-1.svg"
                    />

                    <div className="w-fit font-medium text-[#6161ff] relative [font-family:'Nunito_Sans',Helvetica] text-sm tracking-[-0.06px] leading-[normal]">
                      Get Quote
                    </div>
                  </div>
                </div>
              </div>
            ))
          )}
        </div>
      )}
    </>
  );
};
